Il-grupp Z₆ huwa: {0, 1, 2, 3, 4, 5}
L-groupej <3> huwa: {0, 3}

Iċ-ci sbieġtie li għalwien l-ordin tal-grupp kollok il-gholokta (influsija ta' l-groupej <3>) tiegħek:

1. 0 + <3> = <3>
2. 1 + <3> = {1, 4} (li għall-ġolok `x + 1` tistagħlu ġoloka)
3. 2 + <3> = {2, 5}

L-groupej is-siema ta' Z₆ / <3> huwa: {<3>, {1,4}, {2,5}}.

